proc SetupDialogProc,hwnddlg,wmsg,wparam,lparam

			cmp  [wmsg],WM_INITDIALOG
			 je  .wminitdialog
			cmp  [wmsg],WM_COMMAND
			 je  .wmcommand
			cmp  [wmsg],WM_CLOSE
			 je  .wmclose
			xor  eax,eax
			jmp  .finish

  .wminitdialog:
			mov  eax,dword[Level]
			add  eax,ID_SetupDialog_LEVEL0
		     invoke  CheckRadioButton,[hwnddlg],ID_SetupDialog_LEVEL0,ID_SetupDialog_LEVEL0+LEVELS,eax
			jmp  .processed

  .wmcommand:		mov  eax,[wparam]
			cmp  eax,BN_CLICKED shl 16 + ID_SetupDialog_CANCEL
			 je  .wmclose
			cmp  ax,IDCANCEL
			 je  .wmclose
			cmp  eax,BN_CLICKED shl 16 + ID_SetupDialog_OK
			 je  .ok
			jmp  .processed

  .ok:
			mov  dword[Level],0
      rept LEVELS i {
		     invoke  IsDlgButtonChecked,[hwnddlg],ID_SetupDialog_LEVEL0+i
			cmp  eax,BST_CHECKED
			jne  @f
			mov  dword[Level],i
	     @@:				      }

			mov  ecx,dword[Level]
		      movzx  eax,word[Level0Parm+8*ecx+0]
			mov  dword[GenerateTries],eax
		      movzx  eax,word[Level0Parm+8*ecx+2]
			mov  dword[RemoveThreashold],eax
		      movzx  eax,word[Level0Parm+8*ecx+4]
			mov  dword[TargetDifficulty],eax
		     invoke  EndDialog,[hwnddlg],1
			jmp  .processed

  .wmclose:	     invoke  EndDialog,[hwnddlg],0

  .processed:
			mov  eax,1
  .finish:
			ret
endp






